pragma solidity ^0.4.23;

contract RealEstate {
 struct Buyer {
     address buyerAddress;
     bytes32 email;
     bytes32 passwd;
 }

 mapping (uint => Buyer) public buyerInfo;
 address public owner;
 address[10] public buyers;

event LogBuyRealEstate(
    address _buyer,
    uint _id
);

 constructor () public {
     owner = msg.sender;
 }

 function buyRealEstate(uint _id, bytes32 _email, bytes32 _passwd) public payable {
    require(_id >= 0 && _id <= 9);
    buyers[_id] = msg.sender;
    buyerInfo[_id] = Buyer(msg.sender, _email, _passwd);

    owner.transfer(msg.value);
    emit LogBuyRealEstate(msg.sender, _id);
 }
    function getBuyerInfo(uint _id) public view returns (address, bytes32, bytes32){
        Buyer memory buyer = buyerInfo[_id];
        return (buyer.buyerAddress, buyer.email, buyer.passwd);
    }
    function getAllBuyers() public view returns (address[10]){
        return buyers;
    }
}
